import { Navrouter } from "./Arreglos";

function Navxl() {
  return (

    <div>
        <nav>
            {Navrouter.map(([title])=>{
                <div>
                    <a>{title}</a>
                </div>
            })}
        </nav>
    </div>

  );
}

export default Navxl;
